import styled from 'styled-components'

const ProfilePicture = styled.img`
  margin: 0 auto;
  height: 100%;
  width: 100%;
`

const AboutContainer = styled.div`
  min-height: calc(100vh - 60px);
  margin: 0 auto;
  max-width: 1100px;
  padding: 10px;
  padding-top: 0;
`



const About = () => {
  return (
    <>
      ProfilePicture
    </>
  )
}

export default About
